import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.sass']
})
export class AppComponent {
  title = 'frontend';
}
<section id="body">

  <div class="content">
    <div class="title"></div>

    <div class="description"></div>

    <div class="to-do-list"></div>
  </div>

</section>
